import React from "react";

function Note(props) {

    function handleDelete(){
        props.deteleItem(props.id);
    }

    return (
        
        <div className="note">
            <h1>{props.title}</h1>
            <p>{props.content}</p>
            <button onClick={handleDelete} >delete</button>
        </div>




    )


}

export default Note;
